import React from "react"
import { ToDoData } from "./DoData"

export interface ToDoProps {
    todo: ToDoData
}

const ToDo = ({ todo }: ToDoProps) => {
    return <li key={todo.text}>
        <input type="checkbox" />
        {todo.text}
    </li>
}

export default ToDo
